    "2016-07-27T23:05:05.656602",nt"name": "national-wildlife-health-center-research-progress-report-august-1998-determination-of-lead",nt"isopen":
    false,nt"url": null,nt"notes": "Attached is the progress report for the
    first year of the cooperative research study on lead exposure for black ducks in
    Tennessee. Research objectives included determining the current prevalence of blood
    lead exposure in adult black ducks wintering in Tennessee, and comparing current
    prevalence of blood lead exposure to prevalence obtained during 1986-88. In summary,
    it was found that lead exposure has significantly declined in adult black ducks
    during the last 10 years. However, lead exposure has not declined in juvenile birds.",nt"license_title":
